import axios from 'axios';

const API_URL = 'http://localhost:3001/api/users';
const API_URL2 = 'http://localhost:3001/api/users/add';


const getUsers = () => {
    return axios.get(API_URL);
};

const createUser = async(userData) => {
    return await axios.post(API_URL2, userData);
};



export default {
    getUsers,
    createUser,

};
